sourcesContent:
import React from 'react';
import logo from './ranchlogo.svg';

function Grid({ robotPosition }) {
    const div_id=(robotPosition.x+(robotPosition.y*5));
    const func_setstyle=(id)=>{
        if(id==div_id)
        {
            return "game-screen__cell flex items-center justify-center w-20 aspect-square border-amber-800 border-2 bg-amber-500 hover:bg-opacity-75 duration-300";
        }
        if(id==25)
        {
            return "game-screen__cell flex items-center justify-center w-20 aspect-square border-amber-800 border-2 bg-red-700 hover:bg-opacity-75 duration-300";
        }
        else
        {
            return "game-screen__cell flex items-center justify-center w-20 aspect-square border-amber-800 border-2 bg-amber-500 hover:bg-opacity-75 duration-300";
        }
    };
  return (
    <div className='flex flex-col items-center justify-center overscroll-contain'>
        <div className=' w-full '>
